eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   events: () => (/* binding */ events)\n/* harmony export */ });\nconst events = [\n    {\n        eventname: \"PressNote200525\",\n        category: \"\",\n        country: \"International\",\n        type: \"news\",\n        date: \"05/20/25\",\n        author: \"\",\n        // title\n        title_en: \"ENDGAME: a new EU project to strengthen media literacy through educational escape rooms\",\n        title_sr: \"\",\n        title_es: \"\",\n        title_fi: \"\",\n        // subtitle\n        description_en: \"Six organisations from Finland, Serbia, and Spain join forces to fight disinformation among young people using game-based learning\",\n        description_sr: \"\",\n        description_es: \"\",\n        description_fi: \"\",\n        image: \"/newsENDGAME_imagePlaceholder.png\",\n        // html\n        htmlbody_en: `\n  <p>\n    The European project <strong>ENDGAME</strong>  Escaping New Disinformation through Gamified cross-border Media literacy Education has officially kicked off with a consortium online meeting marking the launch of this 24-month initiative. Funded by the Creative Europe Programme (CREA-CROSS-2024-MEDIALITERACY), ENDGAME aims to empower European youth with the skills to critically engage with information, identify disinformation, and navigate digital media environments responsibly.\n  </p>\n\n  <h2 className='news'>Project Partners</h2>\n  <ul>\n    <li><strong>University of Eastern Finland (UEF)</strong>  (Finland) Project coordinator</li>\n    <li><strong>Faktabaari</strong> (Finland)</li>\n    <li><strong>Belgrade Metropolitan University (BMU)</strong> (Serbia)</li>\n    <li><strong>Novi Sad School of Journalism (FNT)</strong> (Serbia)</li>\n    <li><strong>Universidad Politcnica de Madrid (UPM)</strong> (Spain)</li>\n    <li><strong>Fundacin Maldita.es</strong> (Spain)</li>\n  </ul>\n\n  <h2>About the Project</h2>\n  <p>\n    ENDGAME leverages the power of educational escape rooms to simulate real-life media scenarios where players must solve puzzles and complete challenges while building their critical thinking and media literacy skills. These innovative tools will address pressing topics such as AI-generated disinformation, personal data risks, and manipulated content, and will be tailored to each partner country through participatory design processes involving local communities and stakeholders.\n  </p>\n\n  <p>\n    During the kick-off meeting, held online in March 2025, the partners defined the strategic roadmap for the projects first phase, including the co-creation of country-specific narratives and the organisation of participatory workshops in Finland, Serbia and Spain. The escape rooms will be playable in schools, public spaces and online, complemented by competitions, teacher training events, streaming activities on platforms like Twitch, and presentations at conferences and educational fairs.\n  </p>\n\n  <p>\n    ENDGAME has a total budget of <strong>712,831.86</strong>, with <strong>498,982.30</strong> co-funded by the European Union. The project will reach hundreds of young people, educators and other stakeholders through hands-on, inclusive activities, while also generating research-based insights into media literacy gaps via learning analytics.\n  </p>\n\n  <h2>Follow us on Social Media!</h2>\n  <ul>\n    <li><strong>Instagram:</strong> <a target=\"_blank\" href=\"https://www.instagram.com/endgame.project\">endgame.project</a></li>\n    <li><strong>X (Twitter):</strong> <a target=\"_blank\" href=\"https://twitter.com/endgame_project\">endgame_project</a></li>\n    <li><strong>TikTok:</strong> <a target=\"_blank\" href=\"https://www.tiktok.com/@endgame.project\">@endgame.project</a></li>\n    <li><strong>LinkedIn:</strong> <a target=\"_blank\" href=\"https://www.linkedin.com/company/end-game-project-477149364\">end-game-project</a></li>\n  </ul>\n\n  <h2>Contact</h2>\n  <p>\n    <strong>Project coordination:</strong> UEF, Sonsoles Lpez Pernas  \n    <a href=\"mailto:sonsoles.lopez@uef.fi\">sonsoles.lopez@uef.fi</a>  \n    <a href=\"https://sonsoles.me\" target=\"_blank\">https://sonsoles.me</a>\n  </p>`,\n        htmlbody_sr: ``,\n        htmlbody_es: ``,\n        htmlbody_fi: ``,\n        // other\n        externalLinkJoin: \"\",\n        keywords: [\n            \"Event Launch\"\n        ],\n        socialLinks: [\n            {\n                name: \"Instagram\",\n                icon: `InstagramIcon`,\n                url: \"https://www.instagram.com/endgame.project\",\n                handle: \"endgame.project\"\n            },\n            {\n                name: \"X (Twitter)\",\n                icon: `TwitterIcon`,\n                url: \"https://twitter.com/endgame_project\",\n                handle: \"endgame_project\"\n            },\n            {\n                name: \"TikTok\",\n                icon: `TikTokIcon`,\n                url: \"https://www.tiktok.com/@endgame.project\",\n                handle: \"@endgame.project\"\n            },\n            {\n                name: \"LinkedIn\",\n                icon: `LinkedInIcon`,\n                url: \"https://www.linkedin.com/company/end-game-project-477149364\",\n                handle: \"end-game-project\"\n            }\n        ]\n    },\n    {\n        eventname: \"ParticipatoryDesignWorkshop\",\n        category: \"Workshop\",\n        country: \"International\",\n        type: \"Event\",\n        date: \"05/20/25\",\n        hour: \"15:00 UTC+1\",\n        title_en: \"Designing Educational Escape Rooms to Combat Disinformation\",\n        title_sr: \"Dizajn edukativnih soba za bekstvo za borbu protiv dezinformacija\",\n        title_es: \"Diseo de salas de escape educativas para combatir la desinformacin\",\n        title_fi: \"Opetuksellisten pakopelien suunnittelu disinformaation torjumiseksi\",\n        description_en: `Are you an educator, media literacy expert, designer, or game developer aged 18 to 25  or part of a civil society or media organization? Join us!\nWe invite you to participate in an online international webinar on Tuesday, May 20, at 3:00 PM, where we will co-design the storyline and format of educational escape rooms using a participatory design approach.\nThis two-hour session will bring together experts and young creatives to share their perspectives and collaboratively develop narratives, characters, and puzzles that help youth recognize disinformation and strengthen their critical thinking skills.\nThrough a series of co-design workshops held at several stages of the project, we will define the narrative, format, and themes of the escape rooms in ways that are intrinsically motivating and engaging for the youth  going beyond traditional learning activities. We are committed to involving diverse groups  including individuals from different genders, ethnicities, abilities, and backgrounds  to ensure the visuals and storylines are inclusive, respectful, and relevant to a wide audience.`,\n        description_sr: `Da li ste nastavnik, strunjak za medijsku pismenost, dizajner ili developer igara uzrasta od 18 do 25 godina  ili deo organizacije civilnog drutva ili medijske organizacije? Pridruite nam se!\nPozivamo vas da uestvujete na meunarodnom vebinaru koji e se odrati onlajn u utorak, 20. maja, u 15:00 asova, gde emo zajedniki osmiljavati priu i format edukativnih soba za bekstvo koristei pristup participativnog dizajna.\nOva dvoasovna sesija okupie strunjake i mlade kreativce kako bi podelili svoje perspektive i zajedno razvili narative, likove i zagonetke koje pomau mladima da prepoznaju dezinformacije i ojaaju svoje vetine kritikog miljenja.\nKroz niz radionica participativnog dizajna koje e se odravati u razliitim fazama projekta, definisaemo narativ, format i teme soba za bekstvo na nain koji motivie i angauje mlade  prevazilazei granice tradicionalnih obrazovnih aktivnosti. Posveeni smo ukljuivanju razliitih grupa  ukljuujui osobe razliitog pola, etnike pripadnosti, sposobnosti i porekla  kako bismo osigurali da vizuali i prie budu inkluzivni, sa potovanjem predstavljeni i relevantni za iroku publiku.`,\n        description_es: `Eres educador, experto en alfabetizacin meditica, diseador o desarrollador de juegos, o formas parte de una organizacin de la sociedad civil o de medios de informacin? Aydanos!\nTe invitamos a participar en un seminario web online (en ingls) el martes 20 de mayo a las 15:00 horas, donde co-disearemos la narrativa y el formato de escape rooms educativas utilizando un enfoque de diseo participativo.\nEsta sesin de dos horas reunir a expertos y jvenes para compartir sus perspectivas y desarrollar de manera colaborativa narrativas, personajes y retos/puzzles que ayuden a los jvenes a reconocer la desinformacin y fortalecer sus habilidades de pensamiento crtico.\nA travs de una serie de talleres de co-diseo que se llevarn a cabo en varias etapas del proyecto, definiremos la narrativa, el formato y los temas de las escape rooms de manera que resulten motivadoras y atractivas para los jvenes, yendo ms all de las actividades de aprendizaje tradicionales. Estamos comprometidos con la inclusin de grupos diversos incluyendo personas de diferentes gneros, etnias, capacidades y orgenes para asegurar que los elementos visuales y las historias sean inclusivos, respetuosos y relevantes para una audiencia amplia.`,\n        description_fi: `Oletko opettaja, medialukutaidon asiantuntija, pelisuunnittelija tai -kehittj iltsi 1825 vuotta, tai tyskenteletk kansalaisjrjestss tai mediatoimijana? Liity mukaan!\nKutsumme sinut osallistumaan kansainvliseen verkkoseminaariin tiistaina 20. toukokuuta klo 15:00, jossa yhteissuunnittelemme opetuksellisten pakopelien tarinoita ja muotoja osallistavan suunnittelun keinoin.\nTss kahden tunnin typajassa asiantuntijat ja nuoret luovat yhdess tarinoita, hahmoja ja pulmia, jotka auttavat nuoria tunnistamaan misinformaatiota ja vahvistamaan kriittisen ajattelun taitojaan.\nSarjassa eri vaiheisiin ajoittuvia yhteissuunnittelutypajoja mrittelemme pakopelien narratiivin, rakenteen ja teemat siten, ett ne ovat nuorille sisisesti motivoivia ja houkuttelevia, ylitten perinteisten oppimistoimintojen rajat. Olemme sitoutuneet moninaisuuden huomioimiseen  mukaan lukien eri sukupuolet, etnisyydet, toimintakyvyt ja taustat  varmistaaksemme, ett visuaaliset elementit ja tarinat ovat inklusiivisia, kunnioittavia ja merkityksellisi laajalle yleislle.`,\n        externalLinkJoin: \"https://uef.zoom.us/meeting/register/d-Ok41vZS_W_fMGyBERFAw#/registration\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\",\n            \"Escape room\",\n            \"Participatory design\"\n        ]\n    },\n    {\n        eventname: \"WorkshopFinland\",\n        category: \"Workshop\",\n        country: \"Finland\",\n        type: \"Event\",\n        date: \"05/16/25\",\n        hour: \"12:00 UTC+3\",\n        title_en: \"Misinformation narratives in Finland\",\n        description_en: `Were inviting participants to take part in a media literacy workshop as part of the EU-funded ENDGAME project. If you are between 18 and 30 years old and are tired of being exposed to misinformation (e.g., related to migrants, climate change, or cryptocurrency), we want to hear your experience! \n\n    In this interactive session, you'll help identify the most pressing misinformation narratives and media literacy challenges facing young people today. The results will be used to design educational escape rooms that train critical thinking and digital resilience.`,\n        externalLinkJoin: \"https://docs.google.com/forms/d/e/1FAIpQLScyhbCM1wKiRlkt-z8dfbtDKazVuA3T2Xh_1fJ3BZJMSWcLtg/viewform\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSerbia\",\n        category: \"Workshop\",\n        country: \"Serbia\",\n        type: \"Event\",\n        date: \"05/14/25\",\n        hour: \"18:00 UTC+1\",\n        title_en: \"Online workshop: Identifying disinformation\",\n        title_sr: \"Virtuelna radionica: Identifikacija dezinformacija\",\n        description_en: ` If you work in journalism or teaching, are a student or work with young people, we need you!\n   \nOn Wednesday, May 14 at 6:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Serbian youth.  \n \nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project.  `,\n        description_sr: `Ako radite u novinarstvu ili nastavi, student ste ili radite sa mladima, potrebni ste nam!\n\nU sredu, 14. maja u 18:00 asova pozivamo vas da uestvujete u jednoasovnoj onlajn sesiji u kojoj cemo razgovarati, deliti ideje i sluati vaa iskustva kako bismo analizirali digitalne navike i dezinformacije sa kojima se suoavaju mladi u Srbiji.\nU ovoj sesiji, strunjaci ce doprineti svojim razmiljanjima i iskustvom kako bi pomogli u oblikovanju razliitih obrazovnih materijala koji ce pomoci mladima da prepoznaju dezinformacije i ojaaju svoje kritiko rmiljenje. elimo da ovi resursi budu zaista korisni, pristupani i povezani sa stvarnim potrebama drutva. Da bismo to postigli, potrebni su nam ljudi poput vas. Vae prisustvo je ogromna pomoc svima nama koji radimo na ovom projektu. `,\n        externalLinkJoin: \"https://forms.gle/aL2x5URUz1sEbJLaA \",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    },\n    {\n        eventname: \"WorkshopSpain\",\n        category: \"Workshop\",\n        country: \"Spain\",\n        type: \"Event\",\n        date: \"05/07/25\",\n        hour: \"17:00 UTC+1\",\n        title_en: \"Narratives under the Magnifying Glass: Designing Educational Tools against Disinformation\",\n        title_es: \"Narrativas bajo la Lupa: Diseando Herramientas Educativas contra la Desinformacin\",\n        description_en: `If you work in journalism or teaching, are a student or work with young people, we need you! \n    \nOn Wednesday, May 7 at 5:00 pm we invite you to participate in a one-hour online session in which we will talk, share ideas and listen to your experience to analyze the digital habits and misinforming narratives faced by Spanish youth.  \n\nIn this session, experts will contribute their opinions and experiences to help shape various educational materials to help youth recognize disinformation and strengthen their critical thinking. We want these resources to be truly useful, accessible and connected to the real needs of society. To achieve this, we need people like you. Having you is a huge help to all of us who are designing this project. `,\n        description_es: `\nSi te dedicas al periodismo o la docencia, eres estudiante o trabajas con jvenes, te necesitamos! \n    \nEl mircoles 7 de mayo a las 17:00 h (hora Madrid) te invitamos a participar en una sesin online de una hora en la que conversaremos, compartiremos ideas y escucharemos tu experiencia para analizar los hbitos digitales y las narrativas desinformadoras a las que se enfrenta la juventud espaola.  \n\nEn esta sesin, personas expertas aportarn su opinin y vivencias para ayudar a dar forma a diversos materiales educativos que ayuden a a juventud a reconocer la desinformacin y a fortalecer su pensamiento crtico. Queremos que estos recursos sean verdaderamente tiles, accesibles y conectados con las necesidades reales de la sociedad. Para lograrlo, necesitamos contar con personas como t. Contar contigo es una enorme ayuda para todas las personas que estamos diseando este proyecto. `,\n        // short description -> eventCard\n        externalLinkJoin: \"https://forms.gle/6HugpAZw7oSqDTc56\",\n        keywords: [\n            \"Workshop\",\n            \"Media literacy\",\n            \"misinformation\"\n        ]\n    }\n];\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./constants/events.js\n");

